// Sequence starts at 29, because of seq embedded in magic packets. (0xEB >> 3)
var seq = 29; 
function GetPacketSequence()
{
    seq++;
    if (seq > 31) seq = 1;
    
    var shift = seq << 3;

    return shift + 4;
}


var table = [];
var PEC_MSB_MASK = 1 << (8 - 1);
var PEC_MASK = (PEC_MSB_MASK << 1) - 1;
var PEC_POLY = (0b100000111 & PEC_MASK);


function GeneratePecTable() {
    for (var iIdx = 0; iIdx < 256; iIdx++) {
        var iReg = iIdx;
        for(var iBit = 0; iBit < 8; iBit++){
            if ((iReg & PEC_MSB_MASK) !== 0) {
                iReg = (iReg << 1) ^ PEC_POLY;
            } else {
                iReg = (iReg << 1);
            }
        }
        table[iIdx] = iReg & PEC_MASK;
    }
}


function ComputePec(bytes) {
    if (table.length === 0) { GeneratePecTable(); }

    var iCrc = 0;
    var sStr = "PEC:";
    for (var iIdx = 0; iIdx < bytes.length; iIdx++) {
        var iTableIdx = iCrc ^ bytes[iIdx];
        iCrc = table[iTableIdx];
        if (iIdx === 0){
            sStr += bytes[iIdx] + ' ';
        } else {
            sStr += bytes[iIdx].toString(16) + ' ';
        }
    }

    return iCrc;
}
